import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <input placeholder="Produto"></input>
        <input type="button">Salvar</input>
      </header>
    </div>
  );
}

export default App;
